import styled from "styled-components";

const Sidebar = styled.aside`
width: 15%;
justify-content: center;
display: flex;
margin-top: 10%;
font-size: 20px;
text-align: center;
font-weight: 600;
`;

const Aside = ({props}) => {
    return(
        <Sidebar>
            <label>
                <input type="checkbox"/>
                {props.label}
            </label>
        </Sidebar>
    )
}
export default Aside;
